import React from 'react';
import './App.css';
import { BrowserRouter as Router, Switch, Route } from "react-router-dom"
import Home from "./pages/Home"
function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path="/search">
            {/* <searchPage /> */}
            <h1>This is he earch page</h1>
          </Route>
          <Route path="/">
            <Home />
          </Route>
        </Switch>
        <h1>Hey raat kumar gupt</h1>
        <Home />
      </Router>

    </div>
    // home(the one with ther search on)
    // search page(the search result)f
  );
}

export default App;
